import React from 'react';
import classes from './DropDown.module.css'
const DropDown = (props) => {

const passValue = (e) =>{
  e.preventDefault()
} 
props.fillInput(e)
  return (
    <div>
      <div>{props.dataSource ? props.dataSource.data.map(
        city => {
          return (
            <button onClick={passValue} className={classes.list} key={city.id}>{city.name}</button>
          )
        }
      ) : 'hi'}</div>
    </div>
  )
}

export default DropDown
